import React from 'react';
import {Button, Container, Form,Row,Col} from "react-bootstrap";

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Col>
          <Form>
            <Form.Select>
              <option>Select any option</option>
            </Form.Select>
          </Form>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
